    private function unpost(UnitTester $I)
    {
        $this->set_permission($I, 'news.edit', ['news.permissions.manage']);

        $I->canSee('Set as unposted', 'a.posts-status');
        $I->click('a.posts-status');
        $I->waitForAjax(25);
        $I->dontSee('Set as posted', 'a.posts-status');
        $I->canSee('Set as posted', 'a.posts-status');
    }

    private function post(UnitTester $I)
    {
        $this->set_permission($I, 'news.edit', ['news.permissions.manage']);

        $I->canSee('Set as unposted', 'a.posts-status');
        $I->dontSee('Set as posted', 'a.posts-status');

        $I->click('a.posts-status');
        $I->waitForAjax(25);
        $I->canSee('Set as posted', 'a.posts-status');
        $I->dontSee('Set as unposted', 'a.posts-status');
    }

    /**
     * @method set_permission
     * @param UnitTester $I
     * @param string $whichever
     * @param array $group_1
     */
    private function set_permission($I, $whichever, array $group_1)
    {
        // Needed in case we come from another test that has left authorization in an incorrect state.
        $this->logout($I);

        $I->login_as_admin();
        $I->enable_module('Forum');
        $I->enable_module('News');

        $I->checkOption('.item input[name="groups[news.permissions.manage]"]');

        foreach ($group_1 as $group)
        {
            $I->checkOption('.item input[name="groups[news.category.' . $group . ']"]');
        }

        $I->click('#submit');
        $I->waitForAjax(10);

        $I->updateInDatabase('groups', ['permissions' => 3], ['group_id' => 3]);
        $I->updateInDatabase('groups', ['permissions' => 3], ['group_id' => 4]);
        $I->updateInDatabase('groups', ['permissions' => 3], ['group_id' => 5]);

        $this->logout($I);
        $I->login_as_user();
        $I->enable_module('Forum');
        $I->enable_module('News');

        $this->go_to_news($I);

        $I->canSee('Edit Category 1 News Post #1 - Title');
        $I->cantSee('Edit Category 2 News Post #1 - Title');
    }

    private function delete_post(UnitTester $I)
    {
        $this->set_permission($I, 'news.delete', ['news.permissions.manage']);

        $I->canSeeElement('a.delete');
        $I->deleteFromDatabase('posts', ['post_id' => 1]);
        $I->dontSee('Edit Category 1 News Post #1 - Title');
    }
