class Message {
  constructor(/* args */) {
    this.value = arguments[0];
    this.type = Array.isArray(this.value) ? 'list' : 'string';
  }

  // TODO: Your code here

  reverse() {
    if (this.type == 'string') {
      this.value = this.value.split('').reverse().join('');
      return this;
    } else if (this.type == 'list') {
      this.value = this.value.map(function (element, index, array) {
        return reverseFirstLast(element);
      });
      return this;
    }
  }

  toString() {
    if (this.type == 'string') {
      return this.value;
    } else if (this.type == 'list') {
      return this.value.join(' ');
    }
  }
}

